// mainInterface.js
import React from 'react';
import './mainInterface.css';

const MainInterface = () => {
    return (
        <div className="main-interface">
            <LeftPanel />
            <RightPanel />
        </div>
    );
};

const LeftPanel = () => {
    return (
        <div className="left-panel">
            <NewInterviewButton />
            <HistoryList />
            <UserNameButton />
        </div>
    );
};

const NewInterviewButton = () => {
    return (
        <button className="new-interview-button">+ New Interview</button>
    );
};

const HistoryList = () => {
    return (
        <div className="history-list">
            {/* Your list of historical interviews */}
        </div>
    );
};

const UserNameButton = () => {
    return (
        <button className="user-name-button">User Name</button>
    );
};

const RightPanel = () => {
    return (
        <div className="right-panel">
            <InfoBar />
            <MessageInput />
        </div>
    );
};

const InfoBar = () => {
    return (
        <div className="info-bar">
            {/* Information bar content */}
        </div>
    );
};

const MessageInput = () => {
    return (
        <div className="message-input">
            <input type="text" placeholder="Type your message here..." />
        </div>
    );
};

export default MainInterface;
